import React, {Component} from 'react';
import { Row, Col, CardBody,CardText, CardTitle } from 'reactstrap';

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="card" sm="12" md="6" lg="4">
        <CardBody className="card-body">
          <p class="card-title">{this.props.gitCli.title}</p>
            <p class="card-text">{this.props.gitCli.description}</p>
              <button class="button">{this.props.gitCli.cli}</button>
        </CardBody>
     </div>
    );
  }
}

export default Card;
